description:
Verenigde Staten
Avontuur / Science-Fiction
115 minuten

goed

met James Caviezel, Sophia Myles en Jack Huston

Ten tijde van de hoogtijdagen van de Vikingen, landt de buitenaardse man Kainan op de aarde. Kainan is echter niet alleen op de 
aarde gekomen. Het buitenaardse roofdier Moorwen heeft hem vergezeld. Deze twee gezworen vijanden zetten hun strijd dan ook voort 
op de aarde. Om Moorwen te verslaan, zoekt Kainan hulp bij de Vikingen.
